(6, '2025-05-03-b3c3d567-c144-44c8-8170-fffa79e5f7d5.jpg', 'Bathroom Design Ideas.', 'bathroom-design-ideas', '<p>Spesifikasi :</p><p>Ukuran (Luas) Kamar mandi : 2m x 2.50m</p><p>Lantai : Homogeneous Tile (60cm x 60cm), matt model.</p><p>Dinding : Keramik (30cm x 30cm) grey, matt model.</p><p>&nbsp;</p>', 'testing,aja,ya', 1, 1, 11, '2025-03-29 18:06:50', '2025-06-24 13:52:23'),
