(9, '2025-06-24-69eb4fab-32ff-45e7-a0f8-eebf14dab2b6.jpg', 'Lw House Project.', 'lw-house-project', '<p>Project kali ini Kami dipercaya oleh salah satu klien kami untuk membangun rumah tinggal miliknya dari 0 (tanah kavling), yang berlokasi di Sukapura Jakarta Utara.</p><p>Spesifikasi Project :</p><p>Land Area : 12.5m x 20m.</p><p>Building Area : 212.49 m2.</p><p>Klien : Mr. LW.</p><p>Waktu Pengerjaan &nbsp;: &lt; 16 Bulan.</p><p>Tahun Pengerjaan : 2021.</p>', 'abadian,house,zapopa', 1, 1, 11, '2025-05-03 14:52:51', '2025-06-24 07:08:38'),
(10, '2025-06-24-cf96d009-fc0d-4ba7-b713-a266225634e3.jpg', 'Nt House Project.', 'nt-house-project', '<p>Project kali ini Kami dipercaya oleh salah satu klien kami untuk membangun rumah tinggal miliknya dari 0 (tanah kavling), yang berlokasi di Sukapura Jakarta Utara.</p><p>Spesifikasi Project :</p><p>Land Area : 8m x 18.8m.</p><p>Building Area : 146.12 m2.</p><p>Klien : Mr. NT.</p><p>Waktu Pengerjaan &nbsp;: &lt; 12 Bulan.</p><p>Tahun Pengerjaan : 2022.</p>', 'abadia,house,zapopa', 1, 1, 11, '2025-05-03 14:53:39', '2025-06-24 07:07:03'),
(11, '2025-06-24-5ee866bd-da42-48dc-9ae4-53c06d169712.jpg', 'De\' Oasis Green Residence Project.', 'de-oasis-green-residence-project', '<p>Pada Project kali ini Kami berkesempatan berkolaborasi dengan salah satu Developer untuk pengerjaan Cluster De Oasis Green Residence yang berlokasi di Jatiwarna, Bekasi.</p><p>Spesifikasi Project :</p><p>Land Area : 4m x 10m.</p><p>Building Area : 51,8m2.</p><p>Klien : Gethome.</p><p>Waktu Pengerjaan &nbsp;: &lt; 4 Bulan.</p><p>Tahun Pengerjaan : 2023.</p>', 'kontraktorbangunrumah,kontraktorrenovasi,jasakontraktor,jasarenovasi,kontraktorbintaro,kontraktortangerang,kontraktorbekasi,kontraktordepok,kontraktorbogor,kontraktorbandung,kontraktormakassar', 1, 1, 11, '2025-05-03 14:54:52', '2025-06-24 06:27:54');
