(1, 'tentang-kami', '{\"style\":\"vertical-column\",\"thumbnail\":{\"file\":\"2025-05-03-9888ba56-4517-43df-bf73-856de0be42cf.jpg\",\"type\":\"image\"},\"title\":\"Tentang Kami\",\"content\":\"<p style=\\\"margin-left:0in;text-align:justify;\\\"><span class=\\\"text-big\\\" style=\\\"color:black;font-family:Tahoma, Geneva, sans-serif;\\\">Maninjau Sembalun STUDIO adalah penyedia Jasa Konstruksi yang berfokus pada kegiatan usaha untuk Pengerjaan Pembangunan maupun Renovasi Rumah Tinggal, Kost\\u2019an eksklusif, Ruko, villa dan asset properti sejenis lainnya. Dengan cakupan area kerja antara lain Jakarta, Bogor, Depok, Tangerang, Bekasi, Bandung, Padang dan Makassar.<\\/span><\\/p><p style=\\\"margin-left:0in;text-align:justify;\\\"><span class=\\\"text-big\\\" style=\\\"color:black;font-family:Tahoma, Geneva, sans-serif;\\\">Kami menawarkan layanan secara menyeluruh kepada calon Konsumen mulai dari Perencanaan (Design Fa\\u00e7ade 3D dan Layout) Perkiraan Rencana Anggaran Biaya (RAB), hingga proses Pengerjaan Pembangunan.<\\/span><\\/p><p style=\\\"margin-left:0in;text-align:justify;\\\"><span class=\\\"text-big\\\" style=\\\"color:black;font-family:Tahoma, Geneva, sans-serif;\\\">Kami juga memiliki layanan lain yang berkaitan dengan aktifitas konstruksi yaitu Pengerjaan Pembangunan Rumah, Renovasi Rumah, Jasa Design (Interior &amp; Eksterior 3D), Konstruksi Baja dan Besi, Cluster Development dan Pembuatan Kolam Renang.<\\/span><\\/p><p style=\\\"margin-left:0in;text-align:justify;\\\"><span class=\\\"text-big\\\" style=\\\"color:black;font-family:Tahoma, Geneva, sans-serif;\\\">Di dukung oleh Tim yang handal dibidangnya kami berkomitmen memberikan pelayanan terbaik dengan memperhatikan mutu dan kualitas kerja, Ketepatan Waktu dalam penyelesaian Proyek hingga yang terpenting yaitu Kepastian ketetapan Anggaran sesuai dengan Perencanaan yang sebelunya sudah disusun dan disepakati bersama secara tertulis antara Kami selaku Kontraktor dan Konsumen selaku Pemilik Proyek.<\\/span><\\/p><p style=\\\"margin-left:0in;text-align:justify;\\\"><span class=\\\"text-big\\\" style=\\\"color:black;font-family:Tahoma, Geneva, sans-serif;\\\">Kami memberikan Garansi selama 6 bulan baik Jasa maupun Material untuk setiap Project yang Kami tangani.<\\/span><\\/p><h3><span class=\\\"text-big\\\" style=\\\"font-family:Tahoma, Geneva, sans-serif;\\\">Mengapa Harus Kami ?<\\/span><\\/h3><ol><li><span class=\\\"text-big\\\" style=\\\"font-family:Tahoma, Geneva, sans-serif;\\\"><strong>Konsultasi &amp; Perencanaan Gratis.<\\/strong><\\/span><\\/li><\\/ol><p style=\\\"margin-left:40px;\\\"><span class=\\\"text-big\\\" style=\\\"font-family:Tahoma, Geneva, sans-serif;\\\">Kami memberikan layanan Konsultasi secara cuma \\u2013 cuma (Gratis) untuk Perencanaan Hunian Idaman Anda mulai dari Design hingga Rencana Anggaran Biaya Sementara (RABs).<\\/span><\\/p><p><span style=\\\"font-family:Tahoma, Geneva, sans-serif;\\\">2. <\\/span><span class=\\\"text-big\\\" style=\\\"font-family:Tahoma, Geneva, sans-serif;\\\"><strong>Penawaran Terbaik.<\\/strong><\\/span><\\/p><p style=\\\"margin-left:40px;\\\"><span class=\\\"text-big\\\" style=\\\"font-family:Tahoma, Geneva, sans-serif;\\\">Setiap Rencana Anggaran Biaya yang kami Rumuskan disusun secara Proporsional dengan tetap memperhatikan Kualitas Bahan Material yang digunakan, Mutu dan Kualitas Kerja dan tentu Ketersedian Anggaran yang anda miliki.<\\/span><\\/p><p><span style=\\\"font-family:Tahoma, Geneva, sans-serif;\\\">3. <\\/span><span class=\\\"text-big\\\" style=\\\"font-family:Tahoma, Geneva, sans-serif;\\\"><strong>PRO Team.<\\/strong><\\/span><\\/p><p style=\\\"margin-left:40px;\\\"><span class=\\\"text-big\\\" style=\\\"font-family:Tahoma, Geneva, sans-serif;\\\">Perencanaan hingga proses pengerjaan pembangunan rumah kamu dikerjakan oleh Tenaga Kompeten dan berpengalaman dibidangnya termasuk didalamnya Proses Pengawasan \\/ supervisi yang ketat dan dilakukan secara berkala oleh Team Kami hingga proyek selesai dan diserahterimakan kepada konsumen.<\\/span><\\/p><p><span style=\\\"font-family:Tahoma, Geneva, sans-serif;\\\">4. <\\/span><span class=\\\"text-big\\\" style=\\\"font-family:Tahoma, Geneva, sans-serif;\\\"><strong>Periode Garansi.<\\/strong><\\/span><\\/p><p style=\\\"margin-left:40px;\\\"><span class=\\\"text-big\\\" style=\\\"font-family:Tahoma, Geneva, sans-serif;\\\">Kami memberikan Masa Garansi khusus untuk Layanan Pembangunan dan Renovasi Rumah dengan durasi aktif selama 6 Bulan terhitung sejak proses serah terima Kunci dilakukan dari Kami selaku Kontraktor kepada Pemilik Rumah (Konsumen).<\\/span><\\/p><div class=\\\"page-break\\\" style=\\\"page-break-after:always;\\\"><span style=\\\"display:none;\\\">&nbsp;<\\/span><\\/div><h3><span class=\\\"text-big\\\" style=\\\"font-family:Tahoma, Geneva, sans-serif;\\\">VISI :<\\/span><\\/h3><p style=\\\"margin-left:40px;\\\"><span class=\\\"text-big\\\" style=\\\"font-family:Tahoma, Geneva, sans-serif;\\\">Menjadi Perusahaan Kontraktor berkembang yang menjaga Standar Mutu Kerja, Layanan Terbaik dan Ketepatan Waktu dalam Penyelesaian Proyek.<\\/span><\\/p><h3><span class=\\\"text-big\\\" style=\\\"font-family:Tahoma, Geneva, sans-serif;\\\">MISI :<\\/span><\\/h3><p style=\\\"margin-left:40px;\\\"><span class=\\\"text-big\\\" style=\\\"font-family:Tahoma, Geneva, sans-serif;\\\">Mewujudkan Hunian Idaman Klien dari sisi Estetika, Mutu &amp; Kualitas Kerja hingga Anggaran Biaya.<\\/span><\\/p>\"}', 'modal', NULL, '2025-06-24 15:25:23', 'Tentang Kami', ''),
