INSERT INTO `services` (`id`, `title`, `slug`, `icon`, `content`, `keywords`, `an`, `created_by`, `updated_by`, `created_at`, `updated_at`, `image`, `type`, `url_image`) VALUES
(2, 'Renovasi Rumah', 'renovasi-rumah', 'ri-truck-line', '<h3><span class=\"text-big\">Renovasi Total.</span></h3><p>Layanan ini merubah total bentuk bangunan mulai dari tampak muka rumah (Fa√ßade), Perubahan dan Penambahan fungsi Ruang &amp; Bangunan hingga Penambahan Lantai Bangunan.</p><h3><span class=\"text-big\">Renovasi Bidang Ruang.</span></h3><p>Layanan ini secara prinsip hanya merubah dan menambahkan Fungsi Ruang dan Bangunan saja tanpa harus merubah Prinsip Bangunan dan tampak muka rumah.</p><h3><span class=\"text-big\">Renovasi Peritem Kerja.</span></h3><p>Layanan ini hanya mengerjakan beberapa Item Pekerjaan tertentu ya antara lain :</p><p>a. Penggantian Kusen Pintu dan Daun Jendela Almunium.<br>b. Penggantian Plafon.<br>c. Penggantian Atap Rumah.</p><figure class=\"image\"><img src=\"https://maninjausembalun.com/assets/images/editors/1750135366_Flow Process Renov.jpg\"></figure>', 'dfggd,gdfgdfg,ggfhgj,ghjgjuy', 1, 1, 11, '2025-04-01 07:37:37', '2025-06-24 09:59:41', '2025-06-24-098e37dc-d320-4b4d-b234-33c93770910d.jpg', 'image', '2025-06-24-d2eee8b4-5e22-46fa-bc8e-4cbb5d02f8ea.png'),
(3, 'Bangun Rumah', 'bangun-rumah', 'ri-building-line', '<h3><span class=\"text-big\">Siap Bangun.</span></h3><p>Layanan ini untuk kamu yang ingin Bangun Rumah dengan Konsep dan Design Bangunan yang sudah ready ya dimana kami akan mengerjakan Pembangunan Rumah berdasarkan Detail Gambar Kerja yang sudah kamu punya dari Arsitek Kamu.</p><h3><span class=\"text-big\">Konsul Dan Bangun Bersama Kami.</span></h3><p>Untuk Layanan ini diperuntukan bagi kamu yang ingin Konsultasi Bersama Tim kami ya untuk Merencanakan Konsep Rumah Idaman kamu mulai dari Layout, Design Fa√ßade (3D) hingga pembuatan Rencana Anggaran dan Biaya (RAB) setelah semua Perencanaan selesai Proses Pembangunan Rumah Idaman kamu sudah siap dimulai.</p><figure class=\"image\"><img src=\"https://maninjausembalun.com/assets/images/editors/1750134908_Flow Process Bangun.jpg\"></figure>', 'bangun,konsul,design,maninjau,sembalun,studio,konstruksi', 1, 1, 11, '2025-04-01 07:42:50', '2025-06-24 10:08:48', '2025-06-24-54062e93-e53e-444a-b9c6-e41f4808d385.jpg', 'icon', NULL),
(4, 'Cluster Development', 'cluster-development', 'ri-hotel-line', '<h3><span class=\"text-big\">Cluster Development.</span></h3><p style=\"text-align:justify;\"><span class=\"text-big\" style=\"font-family:Tahoma, Geneva, sans-serif;\">Pada layanan ini kami juga membuka peluang Kerjasama dengan sistem KSO untuk Pembangunan Cluster atau Perumahan bagi Anda yang memiliki Lahan / Tanah dengan Persyaratan antara lain :</span></p><ol style=\"list-style-type:lower-latin;\"><li style=\"text-align:justify;\"><span class=\"text-big\" style=\"font-family:Tahoma, Geneva, sans-serif;\">Lahan / Tanah harus Bersertifikat Hak Milik (SHM) atas nama Pribadi dari Konsumen yang menunjuk Kami untuk melakukan Kerjasama Pembangunan Cluster / Perumahan.</span></li><li style=\"text-align:justify;\"><span class=\"text-big\" style=\"font-family:Tahoma, Geneva, sans-serif;\">Luas Lahan / Tanah minimal 1500m2.</span></li><li style=\"text-align:justify;\"><span class=\"text-big\" style=\"font-family:Tahoma, Geneva, sans-serif;\">Tidak ada Pembayaran DP yang kami bayarkan kepada pemilik Lahan sebagai syarat Kerjasama Pembangunan Cluster / Perumahan. d) Para Pihak yaitu Konsumen / Pemilik Lahan dan The Partners STUDIO secara Bersama akan membuat Perjanjian dihadapan Notaris yang ditunjuk oleh kedua belah PIHAK terkait, dengan rincian / detail Kerjasama Pembangunan Cluster / Perumahan dengan sistem KSO.</span></li><li style=\"text-align:justify;\"><span class=\"text-big\" style=\"font-family:Tahoma, Geneva, sans-serif;\">Pembayaran lahan milik Konsumen yang kami kembangkan Menjadi Cluster / Townhouse akan dibayarkan secara bertahap setelah Unit Rumah yang kami pasarkan terjual kepada Calon Pembeli dengan cara pembayaran Cash keras, Cash bertahap maupun KPR via Bank dengan membuka Rekening Bersama.</span></li></ol>', 'cluster,development,Cluster Development,kso,konstruksi,layanan,project', 1, 1, 11, '2025-04-01 11:47:04', '2025-06-17 04:45:52', '2025-05-04-1032598a-b3f4-41dc-95bf-cdbf65ea0037.jpg', 'icon', NULL),
(5, 'Pembuatan Kolam Renang', 'pembuatan-kolam-renang', 'ri-bar-chart-line', '<h3><span class=\"text-big\">Pembuatan Kolam Renang.</span></h3><p>Layanan ini kami peruntukan bagi kamu yang ingin membuat Kolam Renang baik untuk dirumah pribadi kamu, villa atau asset property lain milik kamu ya. Untuk Kolam Renang yang kami kerjakan dibedakan atas sistem sirkulasi ya antara lain :</p><h3>Overflow.</h3><p>Kolam renang model ini menggunakan sistem sirkulasi dengan menggunakan Gutter dikeempat sisi kolam renang untuk menampung tumpahan air dari sisi kolam kemudian, tumpahan air tersebut akan masuk ke Balancing Tank untuk difiltrasi menggunakan Pompa Filter sebelum air dikembalikan ke Kolam.</p><h3>Semi Overflow.</h3><p>Sama seperti Kolam Renang dengan sistem sirkulasi Overflow pada model Kolam Renang Semi Overflow ini juga menggunakan Gutter untuk menampung tumpahan air dari sisi kolam hanya saja Gutter pada Kolam Renang dengan model Semi Overflow cuma terdapat dibeberapa sisi saja.</p><h3>Skimmer.</h3><p>Pada Kolam Renang model Skimmer sistem sirkulasi menggunakan Box Skimmer yang diletakan dibeberapa sisi bagian dalam tembok kolam yang berfungsi untuk menyedot air kolam lalu difiltrasi menggunakan Pompa Filter kemudian air akan dikembalikan ke Kolam. Kolam Renang model Skimmer sangat cocok untuk kamu yang memiliki lahan untuk pembuatan Kolam Renang yang tidak terlalu luas.</p>', 'konstruksi,bangunan,pembuatan kolam renang,maninjau,sembalun,design,semi oveflow,skimmer,property', 1, 1, 11, '2025-04-01 11:53:28', '2025-06-24 12:55:37', '2025-06-24-26d711ef-e414-4fa6-b2f3-755565340ae1.jpg', 'icon', NULL),
(6, 'Jasa Desain', 'jasa-desain', 'ri-palette-line', '<h3><span class=\"text-big\" style=\"font-family:Tahoma, Geneva, sans-serif;\">Jasa Desain.</span></h3><p style=\"text-align:justify;\"><span class=\"text-big\" style=\"font-family:Tahoma, Geneva, sans-serif;\">Pada Layanan ini kami memberikan pilihan layanan kepada Klien antara lain :</span></p><ol style=\"list-style-type:decimal;\"><li style=\"text-align:justify;\"><span style=\"font-family:Tahoma, Geneva, sans-serif;\">&nbsp;</span><span class=\"text-big\" style=\"font-family:Tahoma, Geneva, sans-serif;\">Facade Design (3D).</span></li><li style=\"text-align:justify;\"><span class=\"text-big\" style=\"font-family:Tahoma, Geneva, sans-serif;\">&nbsp;Interior Design (3D).&nbsp;</span></li><li style=\"text-align:justify;\"><span class=\"text-big\" style=\"font-family:Tahoma, Geneva, sans-serif;\">&nbsp;Paket Gambar (Fa√ßade 3D, Layout 2D dan Gambar Kerja).</span></li></ol>', 'Facade,design,interior', 1, 1, 11, '2025-04-01 11:56:14', '2025-06-24 13:02:14', '2025-06-24-accf4981-4376-4e70-be93-8f9a83f724cb.jpg', 'icon', NULL),
(7, 'Konstruksi Baja & Besi', 'konstruksi-baja-besi', 'ri-tools-line', '<h3 style=\"text-align:justify;\"><span class=\"text-big\" style=\"font-family:Tahoma, Geneva, sans-serif;\">Konstruksi Baja &amp; Besi.</span></h3><p style=\"text-align:justify;\"><span class=\"text-big\" style=\"font-family:Tahoma, Geneva, sans-serif;\">Kami melayani permintaan khusus dari kamu untuk Pengerjaan Pembangunan Rumah, Kantor, Restoran dan Gudang dengan penggunaan material Baja dan Besi. Selain pengerjaan Struktur kami juga menerima permintaan perkerjaan yang bersifat kecil seperti Kanopi Kaca / Alderon, Membran Kanopi, Railing Balkon dengan Kaca Tempared dan lain sebagainya.</span></p>', 'tfytytryrty yrtysdfrg,tryryrt,tryryrty', 1, 1, 11, '2025-04-01 11:57:46', '2025-06-17 05:47:13', '2025-06-17-b81c6f48-6041-4ccc-b492-4c4eb42b8c9f.jpeg', 'icon', NULL);
